    }

      margin-top: 3rem;
      padding: 1rem 2rem;
      background-color: hsl(49, 63%, 92%);
      border-radius: 2rem;
    }

    .custom-loader {
      transform: scale(1);
      animation: pulse 0.75s infinite;
    }

    @keyframes pulse {
      0% {
        transform: scale(0.85);
      }

      70% {
        transform: scale(1.25);
      }

      100% {
        transform: scale(0.85);
      }
    }

    #root,
    #cookie-banner {
      opacity: 0;
      animation: fade-in 0.75s ease-out forwards;
    }

    @keyframes fade-in {
      100% {
        opacity: 1;
      }
    }
